import './stylesheet.css';
import HeroLogo from './images/sf_images/seefood_logo_red.png';
import Bubble from './images/sf_images/sf_bubble.png';
import AppConcept from './images/sf_images/seefood_app_concept.png';
import StoryImageOne from './images/section_images/sf_story_image_1.png';
import StoryImageTwo from './images/section_images/sf_story_image_2.png';

function About() {
    return (
        <div>
            <section class="hero">
                <div class="hero-container">
                    <img src={HeroLogo} alt="" />
                    <h1>Meet the Team</h1>
                    <p>The SeeFood Team is filled with talented individuals. See for yourself.</p>
                </div>
            </section>

            <div class="restaurant-grid">
                <div class="restaurant-box">
                    <img src="https://firebasestorage.googleapis.com/v0/b/seefoodapp-eb81d.appspot.com/o/restaurants%2FgmsvxfhzpZpR4DqRov80%2Flogo%2FVilla%20Azteca%20Logo.png?alt=media&token=cb6953b1-ca69-4676-80e9-ff0eb8e9f665" alt="" />
                    <h3>fs</h3>
                    <p>sfvfv</p>
                    <p>SeeFood is a mobile website that helps you see pictures
                                        of food on the menu, instead of just reading about it.</p>
                </div>
            </div>
        </div>
    );
}

export default About;
